var React = require('react');
var ReactDOM = require('react-dom');
var Operation = require('./opeartion/operation-main');
var _ = require('underscore');
var DataText = [
  {id: 1, text: '标题1', color: '#5E5E58', fontFamily: ''},
  {id: 2, text: '标题2', color: '#5E5E58', fontFamily: ''},
  {id: 3, text: '标题3', color: '#5E5E58', fontFamily: ''}
];

var imageLoader = document.getElementById('imageLoader');
imageLoader.addEventListener('change', handleImage, false);

var canvas = new fabric.Canvas('imageCanvas',{backgroundColor: 'rgb(240,240,240)'});
var bgImg = new Image();
bgImg.src = 'data:image/jpeg;base64,';
var bgImgInstance = new fabric.Image(bgImg, {selectable: false});
canvas.add(bgImgInstance);
canvas.moveTo(bgImgInstance, 0);



_.each(DataText, (iTextInstance, index) => {
  iTextInstance.instance =  new fabric.Text(iTextInstance.text, {
    left: 100,
    top: index * 20,
    fontFamily: 'SimSun',
    fill: "#5E5E58",
    fontWeight: '100',
    fontSize: parseInt('24'),
    editable: true,
  });
  if (index == 1) {
    canvas.setActiveObject(iTextInstance.instance);
  }
  canvas.add(iTextInstance.instance);
  canvas.moveTo(iTextInstance.instance, 1);
});

function handleImage(e){
  var reader = new FileReader();
  reader.onload = function(event){
    var img = new Image();
    img.width = 200;
    img.height = 200;

    img.onload = function(){
      var imgInstance = new fabric.Image(img);
      canvas.add(imgInstance);
      canvas.moveTo(imgInstance, 100);
    };
    img.src = event.target.result;
  }
  reader.readAsDataURL(e.target.files[0]);
}


var imageSaver = document.getElementById('imageSaver');
imageSaver.addEventListener('click', saveImage, false);

function saveImage(e){
  this.href = canvas.toDataURL({
    format: 'jpeg',
    quality: 0.8
  });
  this.download = 'test.png';
  console.info(this.href);
}


var App = React.createClass({
  onChange(data) {
    _.each(data, iTextInstance => {
      iTextInstance.instance.set({
        text: iTextInstance.text
      });
    });
    canvas.renderAll();
  },
  onColorChange(value) {
    _.each(DataText, iTextInstance => {
      iTextInstance.instance.setColor('#' + value);
    });
    canvas.renderAll();
  },
  render() {
    return (<div>
      <Operation onChange={this.onChange} data={DataText} onColorChange={this.onColorChange}/>
    </div>);
  }
});

ReactDOM.render(<App/>, document.getElementById('react-container'));

